import pokemons from './pokemons.json';


function Pokemon(props){

    return(
        <div>
            <p>{pokemons.map((poke)=> poke.name.english)}</p>
            <p>{props.type}</p>
            <img src={props.image}/>
        </div>
    )
}
export default Pokemon;
